import { Project } from '../../src/app/models/project';
import * as PIXI from 'pixi.js';
import { ProjectState } from '../../src/app/models/project-state';
import { CollisionFunctions } from '../../src/app/models/collision-functions';
import { Elements } from '../../src/app/models/elements';

export class BoardRecorder {
	private readonly _project: Project;

	private readonly _isReading: boolean;

	private readonly _names: string[];
	private _args: any[];

	private readonly _expectedState: ProjectState;

	constructor(project: Project, isReading: boolean, dataString?: string) {
		this._project = project;
		this._isReading = isReading;
		this._names = [];
		this._args = [];
		if (dataString) {
			const data = JSON.parse(dataString);
			this._names = data[0];
			this._args = data[1];
			this._expectedState = data[2];
		}
	}

	private static isArray(arg: any) {
		return arg && arg[0];
	}

	private static isElement(arg: any) {
		return arg && arg.id !== undefined && arg.pos && arg.pos.x !== undefined;
	}

	private correctType(arg: any): any {
		if (arg) {
			if (arg.x !== undefined) return new PIXI.Point(arg.x, arg.y);
			if (BoardRecorder.isElement(arg)) {
				arg.pos = new PIXI.Point(arg.pos.x, arg.pos.y);
				arg.endPos = new PIXI.Point(arg.endPos.x, arg.endPos.y);
			}
			if (BoardRecorder.isArray(arg)) {
				if (BoardRecorder.isElement(arg[0])) {
					for (let elem of arg) {
						elem.pos = new PIXI.Point(elem.pos.x, elem.pos.y);
						elem.endPos = new PIXI.Point(elem.endPos.x, elem.endPos.y);
						elem = Elements.clone(elem);
					}
				}
				if (arg[0].x !== undefined && arg[1].x !== undefined) {
					for (const elem of this._project.allElements) {
						if (CollisionFunctions.isElementInFloatRect(elem, arg[0], arg[1])) {
							return elem.id;
						}
					}
				}
				if (
					BoardRecorder.isArray(arg[0]) &&
					arg[0][0].x !== undefined &&
					arg[0][1].x !== undefined
				) {
					const ids: number[] = [];
					for (const pos of arg) {
						for (const elem of this._project.allElements) {
							if (
								elem.pos.x === pos[0].x &&
								elem.pos.y === pos[0].y &&
								elem.endPos.x === pos[1].x &&
								elem.endPos.y === pos[1].y
							) {
								ids.push(elem.id);
							}
						}
					}
					if (ids.length !== arg.length) {
						console.log('something happened');
					}
					return ids;
				}
			}
		}
		return arg;
	}

	public call(
		name: string,
		_args: any,
		idIndex?: number,
		idsIndex?: number,
		elemsIndex?: number
	): void {
		try {
			if (this._isReading) {
				const args = { ..._args };
				this._names.push(name);
				this._args.push(args);
				if (idIndex !== undefined && idIndex > -1) {
					const elem = this._project.currState.getElementById(args[idIndex]);
					const positions = [elem.pos.clone(), elem.endPos.clone()];
					Elements.correctPosOrder(positions[0], positions[1]);
					args[idIndex] = positions;
				}
				if (idsIndex !== undefined && idsIndex > -1) {
					for (let i = 0; i < args[idsIndex].length; i++) {
						const elem = this._project.currState.getElementById(
							args[idsIndex][i]
						);
						const positions = [elem.pos.clone(), elem.endPos.clone()];
						Elements.correctPosOrder(positions[0], positions[1]);
						args[idsIndex] = [...args[idsIndex]];
						args[idsIndex][i] = positions;
					}
				}
				if (elemsIndex !== undefined && elemsIndex > -1) {
					args[elemsIndex] = [...args[elemsIndex]];
					for (let i = 0; i < args[elemsIndex].length; i++) {
						args[elemsIndex][i] = Elements.clone(args[elemsIndex][i]);
					}
				}
			}
		} catch (e) {
			console.log('boardrecorder error');
		}
	}

	public doAllCalls(printing?: boolean): void {
		for (let i = 0; i < this._args.length; i++) {
			this.doCall(i, printing);
		}
	}

	public doCall(index: number, printing?: boolean): void {
		if (this._names.length <= index) return;
		const name = this._names[index];
		const args = this._args[index];
		const arr = [];
		for (const p in args) arr.push(this.correctType(args[p]));
		if (printing) console.log('calling', name, 'with', ...arr);
		this._project[name](...arr);
	}

	public stringify(): string {
		const relevant = [this._names, this._args, this._project.currState];
		return JSON.stringify(relevant, (k, v) => (v === undefined ? null : v));
	}

	get expectedState(): ProjectState {
		return this._expectedState;
	}
}

